PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `allies` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `user_id` VARCHAR(255) UNIQUE, `ally_id` INTEGER NOT NULL DEFAULT 0, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL);
CREATE TABLE `xtras` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `user_id` VARCHAR(255) UNIQUE, `grind_call` VARCHAR(255), `special` INTEGER NOT NULL DEFAULT 0, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL);
CREATE TABLE mapdata (id INTEGER PRIMARY KEY AUTOINCREMENT, coordinate VARCHAR (255) UNIQUE, owner_id VARCHAR (255), silver INTEGER NOT NULL DEFAULT 1, gold INTEGER NOT NULL DEFAULT 0, createdAt DATETIME NOT NULL, updatedAt DATETIME NOT NULL, identity STRING DEFAULT (0) NOT NULL);
CREATE TABLE users (id INTEGER PRIMARY KEY AUTOINCREMENT, user_id VARCHAR (255) UNIQUE, permission INTEGER NOT NULL DEFAULT 0, level INTEGER NOT NULL DEFAULT 1, silver INTEGER NOT NULL DEFAULT 10, gold INTEGER NOT NULL DEFAULT 0, createdAt DATETIME NOT NULL, updatedAt DATETIME NOT NULL, mrecord INTEGER DEFAULT (0) NOT NULL);
DELETE FROM sqlite_sequence;
COMMIT;
